package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class SellerRecomendation implements Serializable{	private Integer id;	private Integer sellerId;	private String  email;	private Date 	date;	private Seller	seller;	private Integer	used;		private static final long serialVersionUID = 6526471155622776018L;		public Date getDate() {		return date;	}	public void setDate(Date date) {		this.date = date;	}	public String getEmail() {		return email;	}	public void setEmail(String email) {		this.email = email;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Seller getSeller() {		return seller;	}	public void setSeller(Seller seller) {		this.seller = seller;	}	public Integer getSellerId() {		return sellerId;	}	public void setSellerId(Integer sellerId) {		this.sellerId = sellerId;	}	public Integer getUsed() {		return used;	}	public void setUsed(Integer used) {		this.used = used;	}	}